import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.css";
import "./pages.css";
import axios from "axios";
import { setUsersession } from "../utility/Common";
import { useNavigate } from "react-router-dom";

function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");

  const navigate = useNavigate();

  function UserEmail(e) {
    setEmail(e.target.value);
  }
  function UserPassword(e) {
    setPassword(e.target.value);
  }


  console.log(email);
  console.log(password);

  function LoginUser(e) {
    setError("null");

    e.preventDefault();

    axios
      .post("https://927e-103-141-51-42.in.ngrok.io/api/v1/login", {})
      .then((response) => {
        setUsersession(response.data.token, response.data);
        navigate("/");
      })
      .catch((error) => {
        if (error.response.status === 402)
          setError(error.response.data.message);
        else setError("Someting went to be wrong plese try again later ");
      });
  }

  return (
    <>
      <h4 className="text-center mt-4"> Welcome to login PageðŸ¥³</h4>

      <form className="align" style={{ width: "35%" }} onClick={LoginUser}>
        <div className="form-group">
          <label for="exampleInputEmail1">Email address</label>
          <input
            type="email"
            className="form-control"
            id="InputEmail1"
            value={email}
            onChange={UserEmail}
            aria-describedby="emailHelp"
            placeholder="Enter email"
            required
          />
          <small id="emailHelp" className="form-text text-muted">
            {" "}
            Never share your email with anyone else.
          </small>
        </div>
        <div className="form-group">
          <label for="exampleInputPassword1">Password</label>
          <input
            type="password"
            className="form-control"
            id="exampleInputPassword1"
            value={password}
            required
            placeholder="Password"
            onChange={UserPassword}
          />
        </div>


        <button type="submit" className="btn btn-primary mt-2" >
          Submit
        </button>
      </form>
    </>
  );
}

export default Login;
